import Link from 'next/link';

function Nav({ categories }) {
    return (
        <ul>
            {categories.map((category, i) =>
                <li key={i}>
                    <Link to={`/categories/${category}`}>{category}</Link>
                </li>)
            }
            <li><icon src="fa-search" /></li>
        </ul>
    )
}

export default Nav
